import React, {Component} from "react";
import Tabs from '@mui/material/Tabs';
import Tab from '@mui/material/Tab';
import { withStyles } from '@material-ui/styles';
import IconButton from '@material-ui/core/IconButton';
import ReplayIcon from '@material-ui/icons/Replay';
import { red } from "@mui/material/colors";
import { minHeight } from "@mui/system";
import { withTheme } from "@emotion/react";


const useStyles = theme => ({
    root: {

    },
    tabs: {
        minWidth: 50,
        position: 'absolute',
        top: -8,
        borderRadius: '0px 0px 0px 20px',
        color: 'white'
    },
    tab: {

    },
    tabLabel: {
        marginTop: 7,
        fontWeight: 600,
        fontStyle: 'verdana'
    },
    indicator: {

    }
});

class NavTop extends Component {

    render(){

        const showNav = this.props.state.showNav

        return(
            <>
                <div className={`reset-options-container nav-top-${showNav ? 'active' : 'inactive'}`}>
                    <IconButton className="top-reset-Btn-container" onClick={this.props.resetGrid} color="primary">
                        <div className="topNav-btn-container">
                            <ReplayIcon className="reset-Btn" />
                        </div>
                    </IconButton>
                    <IconButton className="top-erase-Btn-container" onClick={this.props.resetGrid} color="primary">
                        <div className="topNav-btn-container">
                            <ReplayIcon className="reset-Btn" />
                        </div>
                    </IconButton>
                    <IconButton className="top-replay-Btn-container" onClick={this.props.resetGrid} color="primary">
                        <div className="topNav-btn-container">
                            <ReplayIcon className="reset-Btn" />
                        </div>
                    </IconButton>
                </div>
                <div className="progress-bar-container">
                    <progress className='progress-bar' value={this.props.currProgressVal} max={this.props.maxProgressVal}></progress>
                </div>
                <div className={`speed-options-container nav-top-${showNav ? 'active' : 'inactive'}`} sx={{ width: '100%' }}>
                <Tabs
                    // value={value}
                    // onChange={handleChange}
                    textColor="secondary"
                    indicatorColor="secondary"
                    aria-label="secondary tabs example"
                    className={this.props.classes.tabs}
                    value={this.props.state.animationSpeed}
                    onChange={this.props.handleSpeedTabs}
                    variant="fullWidth"
                >
                    <Tab className={this.props.classes.tab} id data-btn={true} value={20} label={<span className={this.props.classes.tabLabel} onClick={this.props.resetGrid}>Slow</span>} />
                    <Tab className={this.props.classes.tab} data-btn={false} value={10} label={<span className={this.props.classes.tabLabel} onClick={this.props.resetGrid}>Normal</span>} />
                    <Tab className={this.props.classes.tab} value={5} label={<span className={this.props.classes.tabLabel}>Fast</span>} />
                </Tabs>
                </div>
            </>
        )
    }
}

export default withStyles(useStyles)(NavTop)
